  b 18.03.1952
  David b. at Bethseda, Maryland, USA and m, at St Andrew's Cathedral Chapel, Hawaii, Honolulu. Moya,
  d/o Richard Norton Davenport and Alita Arkin Salve, b. at Santa Monica, California, USA. Address:
  1283 Honokahua Street, Honolulu, Hawaii 96825.
  David was educated at Changi, Singapore; Oakhurst Grange at Caterham, Surrey, England; and at
  Wellesley College, Scot's College and Wellington Polytechnic, Wellington. He worked for Brickell
  Moss Rankine & Hill in Wellington (1971-75) and spent six months in Western Samoa doing survey work
  on the cross-island road. He lived in Afif, Saudia Arabia while employed by Ballast-Nedam MV to
  build accommodation for the Saudi Arabian Air Force. On his return to New Zealand in 1977 he joined
  Downer and Co and remained with them until 1985. During this time he was Site Engineer for the
  Wellington Milk Treatment facility, Project Manager for the Stockton Open Cast Mine on the West
  Coast of New Zealand, and Site Engineer for the Warangoi Hydroelectric Power Scheme in Papua New
  Guinea. Upon his return from PNG he went to head office in Wellington where he was estimator on
  major projects in New Zealand and on all international projects. He moved to Honolulu, Hawaii in
  1985 where he is Vice President of Command Construction Company.
  Moya received her Bachelor of Arts in Asian Studies at the University of Hawaii, Manoa and her
  Juris Doctorate at the William S Richardson School of Law, University of Hawaii. She worked as a
  lawyer with Ferenz, Williams, Gruskin and Ashton in Guam until 1985 and then with Wong and Oshima
  in Honolulu. She now has her own private practice and is a hearings officer with the State of
  Hawaii.
